import React from "react";
import "./index.css";

const Navbar = function () {
  return (
    <div className="cointainer">
      <div className="nav">Nav</div>
      <div >
        <div className="card1 card"></div>
        <div className="card2 card"></div>
        <div className="card3 card"></div>
      </div>
    </div>
  );
};
export default Navbar;
